		if (this._editedItemType == this.ITEM_TYPE_ZONE)
			this.sendExtensionRequest(this.REQ_GET_ZONE_CONFIG, params);
		else
			this.sendExtensionRequest(this.REQ_GET_ROOM_CONFIG, params);

